      activity was for employees who spent less than 25% of their time on FEA.  Schedule
      H4 expenditures for compliance and treasury services are not for an employee.  The
      provider of these services acts as a consultant.  Expenses paid for voter file
      maintenance are monthly recurring and fixed charges for the maintenance of the
      voter file.   Every effort is made to accurately and timely report to the FEC.'
  expected_count: 5
  input: TEXT,F3XA,,"Amendment addresses FEC letter dated February 13, 2007.  Each
    of the five bullet points are addressed, in their own order.  All joint fundraising
    receipts have been entered as memo entries.  There are timing differences in the
    filing of memo entries and the disbursement of funds from the joint fundraiser.  The  references
    to SC Party Victory Fund relate to transfers in from DNC Services Corporation
    which are reported on the February 20th report covering the period 01/01/2006
    - 01/31/06.  Many of the memo entries recording the receipt are reported on the
    January 31 Year End report.  Due to the nature of elections during the current
    cycle, the SCDP has accurately reported no salaries or wages on Schedule B supporting
    line 30(b) for the time period referred to in the letter from the FEC.  All taxes
    and fringe benefits are treated accurately for this reporting period.  This activity
    was for employees who spent less than 25% of their time on FEA.  Schedule H4 expenditures
    for compliance and treasury services are not for an employee.  The provider of
    these services acts as a consultant.  Expenses paid for voter file maintenance
    are monthly recurring and fixed charges for the maintenance of the voter file.   Every
    effort is made to accurately and timely report to the FEC."
